import { ListGroup, Button } from 'react-bootstrap';
import { v4 as uuidv4 } from 'uuid';

function List({ list }) {
    return (
        <ListGroup>
            {list.map((item) => (
                <ListGroup.Item key={uuidv4()}>
                    <span>{item.link}</span>
                    <span>
                        <a
                            href={item.short_link}
                            style={{ paddingRight: '2em' }}
                        >
                            {item.short_link}{' '}
                        </a>
                        <Button>Copy</Button>
                    </span>
                </ListGroup.Item>
            ))}
        </ListGroup>
    );
}

export default List;
